import './Footer.css';

const Footer = () => {
  return (
    <footer>
      <input id="content" type="text" placeholder="what you have to do..." value="test 123" onChange="test"></input>
      <span id="add-btn">Add</span>
    </footer>
  );
}

export default Footer;
